    border: 1px #63c6ff dotted;
    -moz-border-radius: 20px; border-radius: 20px;
    font-size: 16pt;
    line-height: 28px;
}
ol.volunChecklist {
    
}
ol.volunChecklist li {
    position: relative;
    font-size: 16pt;
    line-height: 28px;
    padding-bottom: 25px;
}
ol.volunChecklist li b, .volunChecklistWrap b {
    font-size: 110%;
}
ol.volunChecklist input {
    position: absolute;
    top: 3px;
    left: -40px;
}


table.complaintTbl {
    width: 100%;
}
table.complaintTbl tr th {
    font-weight: bold;
    border-bottom: 1px #63c6ff solid;
}
table.complaintTbl tr th, table.complaintTbl tr td {
    padding: 5px;
    text-align: left;
    vertical-align: top;
}
table.complaintTbl tr td.botBrd {
    border-bottom: 1px #bbe6ff dotted;
}


.oversightWaysBlock {
-moz-border-radius: 10px; border-radius: 10px;
border: 1px #63C6FF solid;
padding: 10px;
}

.navbar, .navbar-inverse { border-bottom: 0px none; }

#footerLinks {
width: 100%;
max-width: 100%;
padding: 50px 15px;
background: #000;
color: #EEE;
}
#footerLinks a:link, #footerLinks a:active, #footerLinks a:visited, #footerLinks a:hover {
color: #FFF;
}
#footerSocialCol { text-align: left; }
@media screen and (max-width: 992px) {
#footerSocialCol { margin-top: 10px; margin-left: -5px; }
}

@media screen and (max-width: 480px) {
#mce-EMAIL { width: 100%; }
}

.deptRgtCol { width: 116px; }
.scoreRowOn, .scoreRowOff { padding: 10px; }
.scoreRowOn { color: #2B3493; }
.scoreRowOff { color: #CCC; }

#dontWorry { margin-top: 25px; }

.dateFull { display: block; }
.dateAbbr { display: none; }
@media screen and (max-width: 768px) {
    .dateFull { display: none; }
    .dateAbbr { display: block; }
}

#mainNav {
    border-bottom: 0px none;
}
.topNavSearch #dashSearchFrmWrap #dashSearchBg,
.topNavSearchActive #dashSearchFrmWrap #dashSearchBg {
    background: #333;
}
.topNavSearchActive #dashSearchFrmWrap #dashSearchBg {
    background: #000;
    box-shadow: 0px 0px 10px #EEE;
}

#srchBarTbl170, #srchBarTbl110, #srchBarTbl184, #srchBarTbl187 {
    display: none; 
}
select.form-control, select.form-control.form-control-lg {
    background: url(/openpolice/uploads/caret-down.png) 95% center no-repeat !important;
}'
