		DB::table('sl_node')->insert([
			'node_id' => 837,
			'node_tree' => '16',
			'node_type' => 'Page',
			'node_prompt_notes' => 'web-app-technical-specs',
			'node_prompt_after' => 'Web App Specifications for OpenPolice.org::M::We developed custom software in order to thoroughly document our database design. This includes plain-English descriptions of every data table and field.::M::::M::',
