			'node_prompt_text' => '<h2 class="slBlueDark">Donors\' Frequently Asked Questions</h2><p><b>What will your organization do?</b><font face="Roboto Bold, Roboto, sans-serif"><b><br></b></font>We build open data tools to track police conduct. Police agencies are bad at collecting civilian complaints data, and the data they collect, they rarely share. Our software helps police misconduct victims build professional-quality incident reports. Users can file with investigative agencies and publish online, so their data is transparent and searchable.</p><p><b>What\'s new about what you plan to do?</b><font face="Roboto Bold, Roboto, sans-serif"><b><br></b></font>Most police open data projects rely on voluntary data reporting by law enforcement agencies. As a result, such data is limited by inherent flaws, gaps, and biases. For example, data from police sources typically exclude the identity of involved police officers. That makes it practically impossible for outsiders to identify and track the behavior of individual officers.</p><p>OpenPolice.org uses a grassroots data collection strategy, gathering information directly from citizens. That enables better tracking of individual officers. And because we are a non-governmental organization, we are exempt from various state and local laws that block police records from public view.</p><p>We hope to see more governmental and research institutions using grassroots data to supplement government data.<br><br><b>How will you make money?</b><font face="Roboto Bold, Roboto, sans-serif"><b><br></b></font>According to government data, about 4% of 2.9 million annual victims of police misconduct file complaints through departments\' traditional methods. So there is plenty of demand for what we\'ve built to generate revenue with a lead generation service for defense attorneys. We will also have paid subscriptions for intake management software for law firms and investigative agencies. Beyond this free opt-in service, we will never share or sell users\' data.</p><p>This revenue will help us grow and sustain citizen-controlled oversight institutions independent of police control. We can democratize police oversight in the US and forever shift the balance of power between police and the people they serve.</p><p><a href="#n1905" class="btn btn-primary"><i class="fa fa-arrow-circle-o-up mR3" aria-hidden="true"></i> <b>Back to Top, Donate</b></a></p><p><a href="/frequently-asked-questions">Frequently Asked Questions</a></p><p>&nbsp;<br><br></p>'
