			'node_type' => 'Instructions',
			'node_prompt_text' => '<h4>Alyx: Officer Listings<br></h4>
<p>Thank you for your patience, Alyx!</p><p>So I have finally finished updating the installation process for the codebase. I\'ve also created the first batch of tutorials to introduce you — and hopefully others — to the OpenPolice and SurvLoop packages.</p><p><b>Please feel free to email me early and often if you have any questions on the code</b>, or we can hop on video chat &amp; screen share, or perhaps set up a Slack channel. </p><h4>Install Process<br></h4><p>Here is the install process as it currently works on Mac, but it should be similar on Windows once you\'ve got Homestead installed:<br><b><a href="http://openpolice.local/how-to-install-local-openpolice">http://openpolice.local/how-to-install-local-openpolice</a></b></p><p>Here is a breakdown of the OpenPolice package, where your first project will be:<br><a href="http://openpolice.local/code-package-files-folders-and-classes" target="_blank">http://openpolice.local/code-package-files-folders-and-classes</a><br></p><p>Here are the first four introductory tutorials for the SurvLoop package that OpenPolice extends:<br><a href="https://survloop.org/introduction-to-survloop-codebase" target="_blank">https://survloop.org/introduction-to-survloop-codebase</a><br><a href="https://www.youtube.com/playlist?list=PLXYr5wPCFCtxtEis0R0gBh-uXO_OIOMQH" target="_blank">https://www.youtube.com/playlist?list=PLXYr5wPCFCtxtEis0R0gBh-uXO_OIOMQH</a><br></p><p></p><hr><p></p><div><h4><b>Officers Listings<br></b></h4></div><div><b>I\'ve prepared some spots in the codebase where you can start work on the first listings of officers with allegations.</b> The most natural first spot for such a listing is on the department profile pages, e.g.:</div><p><a href="http://openpolice.local/dept/NC-raleigh-police-dept" target="_blank">http://openpolice.local/dept/NC-raleigh-police-dept</a><br></p><p>I have added a new Node to the branching Tree which structures this very complicated department page. This node on the bottom-left has a condition to only be printed with a URL parameter with key, "test". It prints out a header for the officer listings, and dumps the start of the data you\'ll need, which I\'ve passed in to get the ball rolling, e.g.:<br><a href="http://openpolice.local/dept/NC-raleigh-police-dept?test=1" target="_blank">http://openpolice.local/dept/NC-raleigh-police-dept?test=1</a></p><p>Once you have a local copy of OpenPolice installed (I use http://openpolice.local), you will want to submit a test complaint:<br><a href="http://openpolice.local/file-your-police-complaint" target="_blank">http://openpolice.local/file-your-police-complaint</a></p><p>Then you\'ll have your first department with at least one complaint, and you can browse to its department page with "?test=1" on it, and see the spot where we would want to list the officer in your first local complaint. <b>Our goal is to show appropriate information for each complaint\'s privacy setting, and also aggregate multiple anonymous complaints made against the same officer.</b></p><p>Following this public page back to the code... You can see how this page is structure here:<br><a href="http://openpolice.local/dashboard/page/25?all=1&amp;alt=1" target="_blank">http://openpolice.local/dashboard/page/25?all=1&amp;alt=1</a><br></p><p>And you\'ll there that Node #2720 has a note that it is a [ List of Officers Allegations ] hard-coded via OpenOfficers.php function printDeptOfficerComplaints, to view openpolice.nodes.2720-dept-page-officer-listing. So these are the first two files I would love for you to really take over:</p><p><a href="https://github.com/flexyourrights/openpolice/blob/master/src/Controllers/OpenOfficers.php" target="_blank">https://github.com/flexyourrights/openpolice/blob/master/src/Controllers/OpenOfficers.php</a></p><p><a href="https://github.com/flexyourrights/openpolice/blob/master/src/Views/nodes/2720-dept-page-officer-listing.blade.php" target="_blank">https://github.com/flexyourrights/openpolice/blob/master/src/Views/nodes/2720-dept-page-officer-listing.blade.php</a></p><p>To start getting familiar with how the data is organized on the back-end, check out the Database tools in the Admin Area:<br><a href="http://openpolice.local/dashboard/db" target="_blank">http://openpolice.local/dashboard/db</a><br><a href="http://openpolice.local/dashboard/db/table/Officers" target="_blank">http://openpolice.local/dashboard/db/table/Officers</a><br><a href="http://openpolice.local/dashboard/db/table/OfficersVerified" target="_blank">http://openpolice.local/dashboard/db/table/OfficersVerified</a><br><a href="http://openpolice.local/dashboard/db/table/LinksOfficerDept" target="_blank">http://openpolice.local/dashboard/db/table/PersonContact<br></a><a href="http://openpolice.local/dashboard/db/table/LinksOfficerD" target="_blank">http://openpolice.local/dashboard/db/table/LinksOfficerD</a><a href="http://openpolice.local/dashboard/db/table/LinksComplaintDept" target="_blank">ept<br>http://openpolice.local/dashboard/db/table/LinksComplaintDept</a></p><p>Each of these are also defined for <a href="https://laravel.com/docs/5.8/eloquent" target="_blank">Eloquent</a> within the Models folder. Laravel has excellent documentation, including most of what you need to know to start writing database queries:<br><a href="https://laravel.com/docs/5.8/queries" target="_blank">https://laravel.com/docs/5.8/queries</a></p><p>You shouldn\'t need to learn toooo much about the Laravel framework to get started, but if you\'re curious or hungry, <a href="https://laracasts.com/skills/laravel" target="_blank">Laracasts.com</a> seems to have been the premier resource and community for the past few years I\'ve been using it.<br></p><p>Again, don\'t be shy to share any questions or suggestions you have. I really look forward to working with you, and thank you dearly for all that you do!!</p><p>Morgan<br></p>
<p><br></p><hr><p><br></p>'
