			'node_type' => 'Instructions',
			'node_prompt_text' => '<h3>Profile Photo Guidelines and Conditions</h3>
<p>We provide you with the opportunity to add a photograph to your profile to help others recognize you. Your photo can be removed by OpenPolice.org if your profile image doesn\'t include your likeness or a headshot photo. Some examples of photos that shouldn\'t be used are:</p><ul>
