<li>Landscapes</li>
<li>Animals</li>
<li>Words or phrases</li>
</ul><p>If we remove your photo, you can upload a different photo of yourself to remedy this situation. If we remove your photo 3 times, you won\'t be able to upload a photo to your profile again.</p>
